import React from 'react'

const ProductItem = ({data}) => {
    let {product, onAdd} = data
    console.log(product);
  return (
    <div className='my-card'>
      <img className="img img-responsive"  src={data.img} alt={data.name} />
      <h5>{data.name}</h5>
      <div>${data.price}</div>
      <div>
      <Button variant="outline-primary" onClick={() => onAdd(data)}>Agregar al carrito</Button>{' '}
      </div>
    </div>
  )
}

export default ProductItem
